`,o.jsxs(t.li,{children:[o.jsx(t.strong,{children:"Scope AI realistically"}),": Strong game rules can carry weak AI, but overscoping AI ambitions without early planning and robust tooling undermines credibility."]}),`
`,o.jsxs(t.li,{children:[o.jsx(t.strong,{children:"Tooling is essential"}),": Debug visualizers and authoring tools saved the AI effort; in future projects, I'd build these in parallel with core systems."]}),`
`,o.jsxs(t.li,{children:[o.jsx(t.strong,{children:"MVP mindset"}),": Shipping a playable slice with a small set of polished mechanics is more valuable than a half-finished wide feature set."]}),`
